import classNames from 'classnames/bind';
import styles from './FoodCard.module.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHeart } from '@fortawesome/free-solid-svg-icons';

const cx = classNames.bind(styles);

function FoodCard() {
    return (
        <div className={cx('wrapper')}>
            <img
                className={cx('food-img')}
                src="https://cdn.tgdd.vn/Files/2020/06/24/1265202/3-cach-lam-kem-dua-luoi-ngon-ngot-thanh-mat-xua-d-760x367.jpg"
                alt=""
            />
            <h4 className={cx('food-name')}>Kem dua ma lai</h4>
            <div className={cx('food-info')}>Buoc1: Buoc2:</div>

            <div className={cx('food-list-block')}>
                <ul className={cx('food-list')}>
                    <li className={cx('food-list-item')}>Khoai tay</li>
                    <li className={cx('food-list-item')}>Ca chua</li>
                    <li className={cx('food-list-item')}>Rau mui</li>
                </ul>
            </div>
            <div className={cx('food-feedback')}>
                91.1K
                <FontAwesomeIcon icon={faHeart} />
            </div>
        </div>
    );
}

export default FoodCard;
